PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "minutes2" (
	"id"	INTEGER,
	"minutes"	INTEGER,
	"temp"	REAL,
	"time_stamp"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE hours2 (
	id integer PRIMARY KEY,
	date text NOT NULL,
	hour integer NOT NULL,
	temp1 REAL NOT NULL,
	temp2 REAL NOT NULL,
	timestamp integer NOT NULL UNIQUE
);
DELETE FROM sqlite_sequence;
COMMIT;
